        FROM sensorData
		where DateCreated > CURRENT_TIMESTAMP - INTERVAL timeRange MINUTE AND sensorData.DeviceID = deviceID and sensorData.TenantID = tenantID;
        
	WHEN 1 THEN
		SELECT JSON_ARRAYAGG(JSON_OBJECT(
			"battery", Battery,
			"temperature", Temperature,
