        )) as sensorData
        FROM sensorData
        where DateCreated > CURRENT_TIMESTAMP - INTERVAL timeRange YEAR AND sensorData.DeviceID = deviceID and sensorData.TenantID = tenantID;
        ELSE
        select null as sensorData  from sensorData LIMIT 0;
END CASE;
COMMIT;
