CREATE DEFINER=`agrumy`@`%` PROCEDURE `SensorDataReportBuilder`(
    tenantID int,
	deviceID int,
    timeRange int,
    timeMDMY int,
    OUT sensorDataOut LONGTEXT
)
BEGIN
DECLARE sensorDataResult LONGTEXT;
SET TRANSACTION ISOLATION LEVEL READ UNCOMMITTED; -- nolock read, dirty read for sensor 
START TRANSACTION;
-- 0 minute, 1 hour, 2 day, 3 year, add interval 1+
CASE timeMDMY

-- MINUTE RANGE
	WHEN 0 THEN
SELECT JSON_OBJECT("sensorData",JSON_ARRAYAGG(records)) as sensorData
INTO sensorDataResult
FROM -- select with
(
SELECT
	DATE_FORMAT(DateCreated,'%Y-%m-%d %H %i') as dateResult,
	-- Traditional aggregates return a single value.
		JSON_OBJECT(
			"battery", Battery,
			"temperature", Temperature,
			"soilTemperature", SoilTemperature,
			"humidity", Humidity,
			"moisture", Moisture,
			"light", Light,
			"co2", Co2,
			"tvoc", Tvoc,
			"barometer", Barometer,
			"liquidPH", LiquidPH,
			"rainLevel", RainLevel,
			"waterLevel", WaterLevel,
			"wind", Wind,
            "dateCreated",DateCreated
		)	
    AS records
FROM
	sensorData
	WHERE DateCreated > CURRENT_TIMESTAMP - INTERVAL timeRange MINUTE AND sensorData.DeviceID = deviceID and sensorData.TenantID = tenantID 
	AND sensorData.Co2 < 8000 -- solving error data from CSS811 Co2
GROUP BY
	dateResult
) AS sensorDataResult;
	
-- DAY RANGE
    WHEN 1 THEN
SELECT JSON_OBJECT("sensorData",JSON_ARRAYAGG(records)) as sensorData
INTO sensorDataResult
FROM -- select with
(
SELECT
	DATE_FORMAT(DateCreated,'%Y-%m-%d %H') as dateResult,
	-- Traditional aggregates return a single value.
		JSON_OBJECT(
			"battery", Battery,
			"temperature", Temperature,
			"soilTemperature", SoilTemperature,
			"humidity", Humidity,
			"moisture", Moisture,
			"light", Light,
			"co2", Co2,
			"tvoc", Tvoc,
			"barometer", Barometer,
			"liquidPH", LiquidPH,
			"rainLevel", RainLevel,
			"waterLevel", WaterLevel,
			"wind", Wind,
            "dateCreated",DateCreated
		)	
    AS records
FROM
	sensorData
	WHERE DateCreated > CURRENT_TIMESTAMP - INTERVAL timeRange DAY AND sensorData.DeviceID = deviceID and sensorData.TenantID = tenantID 
	AND sensorData.Co2 < 8000 -- solving error data from CSS811 Co2
GROUP BY
	dateResult
) AS sensorDataResult;


-- MONTH RANGE
    WHEN 2 THEN
SELECT JSON_OBJECT("sensorData",JSON_ARRAYAGG(records)) as sensorData
INTO sensorDataResult
FROM -- select with
(
SELECT
	DATE_FORMAT(DateCreated,'%Y-%m-%d') as dateResult,
	-- Traditional aggregates return a single value.
		JSON_OBJECT(
			"battery", Battery,
			"temperature", Temperature,
			"soilTemperature", SoilTemperature,
			"humidity", Humidity,
			"moisture", Moisture,
			"light", Light,
			"co2", Co2,
			"tvoc", Tvoc,
			"barometer", Barometer,
			"liquidPH", LiquidPH,
			"rainLevel", RainLevel,
			"waterLevel", WaterLevel,
			"wind", Wind,
            "dateCreated",DateCreated
		)	
    AS records
FROM
	sensorData
	WHERE DateCreated > CURRENT_TIMESTAMP - INTERVAL timeRange MONTH AND sensorData.DeviceID = deviceID and sensorData.TenantID = tenantID 
	AND sensorData.Co2 < 8000 -- solving error data from CSS811 Co2
GROUP BY
	dateResult
) AS sensorDataResult;

-- YEAR RANGE
	WHEN 3 THEN
SELECT JSON_OBJECT("sensorData",JSON_ARRAYAGG(records)) as sensorData
INTO sensorDataResult
FROM -- select with
(
SELECT
	DATE_FORMAT(DateCreated,'%Y-%m-%d') as dateResult,
	-- Traditional aggregates return a single value.
		JSON_OBJECT(
			"battery", Battery,
			"temperature", Temperature,
			"soilTemperature", SoilTemperature,
			"humidity", Humidity,
			"moisture", Moisture,
			"light", Light,
			"co2", Co2,
			"tvoc", Tvoc,
			"barometer", Barometer,
			"liquidPH", LiquidPH,
			"rainLevel", RainLevel,
			"waterLevel", WaterLevel,
			"wind", Wind,
            "dateCreated",DateCreated
		)	
    AS records
FROM
	sensorData
	WHERE DateCreated > CURRENT_TIMESTAMP - INTERVAL timeRange YEAR AND sensorData.DeviceID = deviceID and sensorData.TenantID = tenantID 
	AND sensorData.Co2 < 8000 -- solving error data from CSS811 Co2
GROUP BY
	dateResult
) AS sensorDataResult;
        ELSE
        select null as sensorData  from sensorData LIMIT 0;
END CASE;

SET sensorDataOut := sensorDataResult;
COMMIT;
END ;;
DELIMITER ;
